import Button from 'react-bootstrap/Button';
import Link from 'next/link';
import React from "react";
const AddtoCartButton = (props) =>{
    return(
        <React.Fragment>
             <Button variant="outline-danger" size="lg" block>
                            ADD TO CART
            </Button>
        </React.Fragment>
    );
}
export default AddtoCartButton;
